                   <!-- content goes here -->\x0D\x0A\x0D\x0A                            <form id=\"add-event-form\">\x0D\x0A                                <fieldset>\x0D\x0A\x0D\x0A                                    <div class=\"form-group\">\x0D\x0A                                        <label>Select Event Icon</label>\x0D\x0A                                        <div class=\"btn-group btn-group-sm btn-group-justified\" data-toggle=\"buttons\" > <!--  -->\x0D\x0A                                            <label class=\"btn btn-default active\">\x0D\x0A                                                <input type=\"radio\" name=\"iconselect\" id=\"icon-1\" value=\"fa-info\" radio-toggle ng-model=\"newEvent.icon\">\x0D\x0A                                                <i class=\"fa fa-info text-muted\"></i> </label>\x0D\x0A                                            <label class=\"btn btn-default\">\x0D\x0A                                                <input type=\"radio\" name=\"iconselect\" id=\"icon-2\" value=\"fa-warning\" radio-toggle  ng-model=\"newEvent.icon\">\x0D\x0A                                                <i class=\"fa fa-warning text-muted\"></i> </label>\x0D\x0A                                            <label class=\"btn btn-default\">\x0D\x0A                                                <input type=\"radio\" name=\"iconselect\" id=\"icon-3\" value=\"fa-check\" radio-toggle  ng-model=\"newEvent.icon\">\x0D\x0A                                                <i class=\"fa fa-check text-muted\"></i> </label>\x0D\x0A                                            <label class=\"btn btn-default\">\x0D\x0A                                                <input type=\"radio\" name=\"iconselect\" id=\"icon-4\" value=\"fa-user\" radio-toggle  ng-model=\"newEvent.icon\">\x0D\x0A                                                <i class=\"fa fa-user text-muted\"></i> </label>\x0D\x0A                                            <label class=\"btn btn-defau